import { styled } from "@mui/system";

const Wrapper = styled("div")({
  width: "100%",
  height: "100vh",
  display: "flex",
  backgroundColor: "#f9f2ef",
  flexDirection: "row",
  position: "relative",
});

export default Wrapper;
